import {Component} from 'react';
import './App.css';
// Or import all of React and use React.Component

class Counter extends Component{
    constructor(props){
        super(props);
        this.state = {
            count: 0
        }
    }
    render(){
        return (
            <div>
                <p className="App">{this.state.count}</p>
                <button>Plus</button>
                <button>Minus</button>
            </div>
        );
    };
}

export default Counter;
